(11, 'Rentme', 'https://carweb.rent/cache/textes/230801093135441_540x0.jpeg', 'Aeropuerto de Palma', 'RENT ME MALLORCA S.L. Rent a Car es su empresa de alquiler de confianza para sus vacaciones en Mallorca. Con mas de 10 a√±os de experiencia, en esta empresa familiar nos enorgullecemos de darle el mejor servicio y el mejor precio a nuestros clientes.', 'https://rentme.webcar.rent/?uc=carweb&_gl=1*1py32zm*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODM2OTQuNDcuMC4w', '2025-06-10 21:28:17', '2025-06-10 21:28:17'),
(12, 'Xoroi Cars', 'https://carweb.rent/cache/textes/230714132709772_540x0.jpeg', 'Aeropuerto de Palma', 'En Xoroi Rent a Car ofrecemos un trato personalizado con disponibilidad de servicio las 24 horas del d√≠a. Disfrute de su veh√≠culo con las mejores garant√≠as de seguridad. Disponemos de sillas para el transporte de bebes y ni√±os, as√≠ como porta-bicicletas. Recoja su coche en el aeropuerto de Palma de Mallorca o en su domicilio en la zona de la Col√≤nia de Sant Pere, Betlem, Art√† ‚Ä¶.', 'https://xoroicars.webcar.rent/?uc=carweb&_gl=1*1ulpi9q*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODUwMDEuNTkuMC4w', '2025-06-10 21:28:19', '2025-06-10 21:28:19'),
(13, 'Iscar', 'https://carweb.rent/cache/textes/230714133920587_540x0.png', 'Aeropuerto de Palma', 'Iscar Rent a Car, compa√±√≠a de alquiler de veh√≠culos en Mallorca con tarifas low cost todo incluido. Sabemos que su tiempo es muy valioso y queremos ayudaros a que sus vacaciones sean inolvidables y se lleven un bonito recuerdo de la preciosa isla de Mallorca.\n\n* Sin esperas, sin colas, sin sorpresas ni gastos a√±adidos. * Flota de veh√≠culos nueva y completa. * Hablamos Ingles, Alem√°n y Espa√±ol. * Entrega y recogida en aeropuerto sin esperas. * Entrega y recogida en toda la isla - Servicio 24 horas. Ll√°menos y comprobara que todo lo que le decimos es cierto...', 'https://iscar.webcar.rent/?uc=carweb&_gl=1*z020es*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODQxNjYuMS4wLjA.', '2025-06-10 21:28:21', '2025-06-10 21:28:21'),
(14, 'Authomar', 'https://carweb.rent/cache/textes/230714133753464_540x0.png', 'Aeropuerto de Palma', 'Es una empresa de alquiler de veh√≠culos fundada con la ilusi√≥n de un equipo humano con larga experiencia en el sector, y con ganas de dar el mejor servicio posible a nuestros clientes.\n\nNuestro objetivo es dar un trato PERSONALIZADO a cada cliente, porque cada persona es diferente y tiene distintas necesidades, y estar a su servicio el tiempo que dure su estancia entre nosotros.\n\nPonemos a su disposici√≥n una flota totalmente nueva, con veh√≠culos de todas las categor√≠as y de marcas reconocidas (Renault, Opel, Audi, Seat, Peugeot, Ford, Volkswagen, Jeep, etc...) equipados con todos los extras... ¬°Incluso en nuestros modelos m√°s b√°sicos!\n\nFruto de una amplia experiencia en el sector, AUTHOMAR les ofrece un servicio integral de alquiler de veh√≠culos:\n\n¬°P√≠danos informaci√≥n sin compromiso!', 'https://authomar.webcar.rent/?uc=carweb&_gl=1*1py32zm*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODM2OTQuNDcuMC4w', '2025-06-10 21:28:24', '2025-06-10 21:28:24'),
(15, 'Autocenter', 'https://carweb.rent/cache/textes/230714134438239_540x0.png', 'Son Bugadelles', 'AUTOCENTER MALLORCA es la empresa de alquiler de coches en la que puede confiar durante sus vacaciones en Mallorca. Las ventajas de alquilar con nosotros:', 'https://minicar.webcar.rent/0/autocenter-mallorca--rent-a-car-Spanish/3?uc=carweb&_gl=1*1rfhbgi*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODUyMjMuNTkuMC4w', '2025-06-10 21:28:26', '2025-06-10 21:28:26'),
(16, 'Autos Roquero', 'https://carweb.rent/cache/textes/230714132454381_540x0.jpeg', 'Aeropuerto de Palma', 'Autos Roquero Rent a Car es su empresa de alquiler de confianza para sus vacaciones en Mallorca. Empresa familiar dedicada al alquiler de coches desde 1978, nos enorgullecemos de dar el mejor servicio al mejor precio a nuestros clientes. Ventajas de alquilar con nosotors son:\n\nPueden solicitar la entrega a domicilio de su coche de alquiler:\n\nEl coste ser√° de hasta 50 euros para entregas o devoluciones en el aeropuerto y Puerto de Palma cuando la duraci√≥n del alquiler sea de 5 a 7 dias. Gratuito para 8 dias o m√°s.\n\nEl coste ser√° de hasta 15 euros para entregas o devoluciones en Hoteles / domicilios de las siguientes localidades:\n\nPaguera, Camp de Mar, Andratx, Puerto Andratx y Santa Ponsa. Cuando la duraci√≥n del alquiler sea de 3 a 7 d√≠as. Gratuito para 8 dias o m√°s.\n\nDisponemos de vehiculos economicos, medianos, familiares, cabrios, 7 plazas, SUV‚Ä≤s. Colaboramos con muchas marcas como: Seat, Ford, Opel, Fiat, BMW/Mini, Jeep, etc...', 'https://autosroquero.webcar.rent/?uc=carweb&_gl=1*yibs8z*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODY0MjguNjAuMC4w', '2025-06-10 21:28:30', '2025-06-10 21:28:30'),
(17, 'Bennasar', 'https://carweb.rent/cache/textes/230714134637435_540x0.jpeg', 'Felanitx', 'Somos una empresa familiar de m√°s de 50 a√±os de antig√ºedad, ofreciendo un trato familiar y personalizado a nuestros clientes lo cual avala nuestra profesionalidad y calidad en nuestro servicio.\n\nDisponemos de una amplia gama de veh√≠culos que se adaptan a las necesidades de nuestros clientes, en diferentes marcas y modelos, con servicio de recogida y entrega en el aeropuerto (con un m√≠nimo de 4 d√≠as) sin esperas ni colas o directamente en nuestras oficinas de Portocolom y Felanitx (Mallorca).\n\nTambi√©n disponemos de una furgoneta de gran capacidad, ideal para mudanzas y transportes con volumen.\n\nAlquilamos ciclomotores tipo Scooter de 125cc.', 'https://rentacarbennasar.webcar.rent/?uc=carweb&_gl=1*1lpspri*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODUxNDEuNTkuMC4w', '2025-06-10 21:28:32', '2025-06-10 21:28:32'),
(18, 'Rosslind', 'https://carweb.rent/cache/textes/230714122953976_540x0.jpeg', 'Aeropuerto de Palma', 'Nuestra empresa familiar con mas de 25 a√±os de experiencia, para su alquiler de coches en Mallorca. Orgullosos de dar el mejor servicio al mejor precio a nuestros clientes. Le atendemos fluidos en espa√±ol, alem√°n, franc√©s, ingl√©s, polaco, italiano y holand√©s.', 'https://rosslind.webcar.rent/?uc=carweb&_gl=1*h63yh5*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODY2NjcuNTIuMC4w', '2025-06-10 21:28:33', '2025-06-10 21:28:33'),
(19, 'Solymar', 'https://carweb.rent/cache/textes/230714132247935_540x0.jpg', 'Aeropuerto de Palma', 'Sol&Mar Rent a Car es su empresa de alquiler de confianza para sus vacaciones en Mallorca. Con mas de 40 a√±os de experiencia, en esta empresa familiar nos enorgullecemos de dar el mejor servicio al mejor precio a nuestros clientes. Ventajas de alquilar con nosotors son:\n\nDisponemos de vehiculos economicos, medianos, familiares, cabrios, 7 y 9 plazas, y furgonetas. Colaboramos con muchas marcas como, Renault, Opel, Nissan, Fiat, Mini, Seat, etc...', 'https://solymar.webcar.rent/?uc=carweb&_gl=1*1ocyvbm*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODQ3MDUuNS4wLjA.', '2025-06-10 21:28:35', '2025-06-10 21:28:35'),
(20, 'Tripcars', 'https://carweb.rent/cache/textes/230707162111417_540x0.png', 'Capdepera', 'Desde 1988 ofrecemos alquiler de coches en la zona Este de Mallorca. Contamos con 5 oficinas y alquilamos todo tipo de veh√≠culos. Siempre con garant√≠a de servicios, asegurando a todo riesgo sin franquicia.', 'https://tripcars.webcar.rent/0/trip-cars--rent-a-car-Spanish/1?uc=carweb&_gl=1*1cprmbc*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4ODk5NTU3MS41Ny4xLjE2ODg5OTU3MzMuMTMuMC4w', '2025-06-10 21:28:37', '2025-06-10 21:28:37'),
(21, 'Cronomotor', 'https://carweb.rent/cache/textes/230714123622665_540x0.jpg', 'Manacor', 'Su Rent a Car de referencia en la zona de Manacor, especialistas en veh√≠culos de bajo coste en Manacor.\n\nTambi√©n disponemos de veh√≠culos comerciales con alquiler de larga estancia, cons√∫ltenos sin compromiso.', 'https://cronomotor.webcar.rent/?uc=carweb&_gl=1*zgekp7*_ga*MTA1MTAyNTM4NC4xNjc2NjIwODk0*_ga_68X8EH3DY1*MTY4OTA3OTIxNi42MS4xLjE2ODkwODYwODMuNjAuMC4w', '2025-06-10 21:28:39', '2025-06-10 21:28:39');
